import { Box, Image } from "@chakra-ui/layout";
import Home_bg from "../Background/home_bg.jpg";
import { motion } from "framer-motion";
import { lemon } from "../Icons/lemon_cake.png";
export default function Home() {
  return (
    <Box
      w="100vw"
      h="100vh"
      bgColor="#ffe067"
      bgImg={Home_bg}
      bgRepeat={"no-repeat"}
      bgSize={"100% auto"}
    >
      <Image src={lemon} position="absolute" />
    </Box>
  );
}
